import React from 'react';
import './App.css';

function App() {
  return (
    <div className="app-container">
      <header className="app-header">
        <h1>My Header</h1>
      </header>
      <main>
        <p>Welcome to my dark-themed app!</p>
      </main>
    </div>
  );
}

export default App;
